import './App.css'

function App() {
  return (
    <div className="App">
      <div className="container-fluid">
        <div className="row" style="display: flex; flex-wrap: wrap">
          <div className="col-sm-3 bg-dark hidden-md-down">
            left
          </div>
          <div className="col-sm-9 bg-light h-100 d-inline-block">
            right
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
